.section {
  transition: transform 1s, opacity 1s;
}

.section--hidden {
  opacity: 0;
  transform: translateY((8rem));
}

#home {
  width: 100%;
  height: 100vh;
  background-image: url('https://i.pinimg.com/originals/3b/8a/d2/3b8ad2c7b1be2caf24321c852103598a.jpg');
  background-size: cover;
  background-position: center;
  overflow: hidden;
  .header {
    display: inline-block;
    position: relative;
    width: 100%;
    .git {
      text-decoration: none;
      color: white;
      display: inline-block;
      font-size: 45px;
      float: left;
      position: relative;
      padding: 56px 0 0 70px;
    }
    nav {
      position: absolute;
      display: inline-block;
      right: 0;
      overflow: hidden;
      padding: 50px 80px 0;
      text-shadow: 2px 2px 1px rgba(0, 0, 0, 1);
      text-align: center;
      ul {
        padding: 0;
        li {
          display: inline-block;
          a {
            display: inline-block;
            text-decoration: none;
            color: white;
            font-size: 24px;
            padding-right: 50px;
          }
        }
      }
    }
  }
  .main {
    text-align: center;
    .heading {
      position: absolute;
      width: 100%;
      bottom: 20px;
      left: 0px;
      overflow: hidden;
      color: white;
      text-shadow: 2px 2px 1px rgba(0, 0, 0, 1);
      h1 {
        display: block;
        font-size: 50px;
        font-weight: 700;
        margin-bottom: 10px;
      }
      h4 {
        font-size: 30px;
        font-weight: 400;
      }
    }

    .git-2 {
      position: absolute;
      text-decoration: none;
      color: white;
      display: inline-block;
      font-size: 20px;
      position: relative;
      margin: 0 auto;
    }
  }

  @media only screen and (max-width: 431px) {
    .header nav ul li a {
      padding: 0 20px 0 0;
    }
  }

  @media only screen and (max-width: 700px) {
    .main .heading h1 {
      font-size: 40px;
    }
    .main .heading h4 {
      font-size: 26px;
    }
    .header nav a {
      font-size: 20px;
    }
  }

  @media only screen and (max-width: 850px) {
    .header .git {
      display: none;
    }
    .header nav {
      float: none;
      text-align: center;
      position: static;
      display: block;
    }
    .projects {
      padding: 0 !important;
    }
  }
  @media only screen and (min-width: 851px) {
    .heading .git-2 {
      display: none;
    }
  }

  @media only screen and (max-width: 1400px) {
    .header .git {
      padding: 55px 0px 0 60;
    }
    .header nav {
      padding: 50px 0px 0 0;
    }
  }
}

